import React from "react";
import { Link } from "react-router-dom";

import "../styles/Header.css";

function Home() {
  return (
    <div className="homepage-div">
      <div>
        <img src="images/quiz.svg" alt="quiz" />
      </div>
      <div>
        <h1>QuizApp</h1>
        <button>Get Started</button>
      </div>
    </div>
  );
}

export default Home;
